tion in aggregated and anonymized form so that it is not  		associated with individual end users and does not include personal  		information.</font></font></p>  	</li></ul>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  </div>  <div id="Section4" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<strong><font color="#000000"><font style="font-size: 11pt" size="3">3.  	WILL YOUR INFORMATION BE SHARED WITH ANYONE?</font></font></strong></p>  </div>  <div id="Section5" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<em><font color="#595959"><font style="font-size: 11pt" size="3">In  	Short:&nbsp; We only share information with your consent, to comply  	with laws, to provide you with services, to protect your rights, or  	to fulfill business obligations.</font></font></em></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="line-height: 150%" align="left"><font color="#595959"><font style="font-size: 11pt" size="3">We  	may process or share your data that we hold based on the following  	legal basis:</font></font></p>  	<ul><li><p class="western" style="line-height: 150%" align="left"><strong><font color="#595959"><font style="font-size: 11pt" size="3">Consent:</font></font></strong><font color="#595959"><font style="font-size: 11pt" size="3">  		We may process your data if you have given us specific consent to  		use your personal information for a specific purpose.</font></font></p>  	</li></ul>  	<ul><li><p class="western" style="line-height: 150%" align="left"><strong><font color="#595959"><font style="font-size: 11pt" size="3">Legitimate  		Interests:</font></font></strong><font color="#595959"><font style="font-size: 11pt" size="3">  		We may process your data when it is reasonably necessary to achieve  		our legitimate business interests.</font></font></p>  	</li></ul>  	<ul><li><p class="western" style="line-height: 150%" align="left"><strong><font color="#595959"><font style="font-size: 11pt" size="3">Performance  		of a Contract:</font></font></strong><font color="#595959"><font style="font-size: 11pt" size="3">  		Where we have entered into a contract with you, we may process your  		personal information to fulfill the terms of our contract.</font></font></p>  	</li></ul>  	<ul><li><p class="western" style="line-height: 150%" align="left"><strong><font color="#595959"><font style="font-size: 11pt" size="3">Legal  		Obligations:</font></font></strong><font color="#595959"><font style="font-size: 11pt" size="3">  		We may disclose your information where we are legally required to  		do so in order to comply with applicable law, governmental  		requests, a judicial proceeding, court order, or legal process,  		such as in response to a court order or a subpoena (including in  		response to public authorities to meet national security or law  		enforcement requirements).</font></font></p>  	</li></ul>  	<ul><li><p class="western" style="line-height: 150%" align="left"><strong><font color="#595959"><font style="font-size: 11pt" size="3">Vital  		Interests:</font></font></strong><font color="#595959"><font style="font-size: 11pt" size="3">  		We may disclose your information where we believe it is necessary  		to investigate, prevent, or take action regarding potential  		violations of our policies, suspected fraud, situations involving  		potential threats to the safety of any person and illegal  		activities, or as evidence in litigation in which we are involved.</font></font></p>  	</li></ul>  	<p class="western" style="line-height: 150%" align="left"><font color="#595959"><font style="font-size: 11pt" size="3">More  	specifically, we may need to process your data or share your  	personal information in the following s