595959">&nbsp;</font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left"><a name="control5"></a><a name="3pwebsites"></a>  	<strong><font color="#000000"><font style="font-size: 11pt" size="3">6.  	WHAT IS OUR STANCE ON THIRD-PARTY WEBSITES?</font></font></strong></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<em><font color="#595959"><font style="font-size: 11pt" size="3">In  	Short:&nbsp;&nbsp;We are not responsible for the safety of any  	information that you share with third-party providers who advertise,  	but are not affiliated with, our Website.</font></font></em></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">The App  	may contain advertisements from third parties that are not  	affiliated with us and which may link to other websites, online  	services or mobile applications. We cannot guarantee the safety and  	privacy of data you provide to any third parties. Any data collected  	by third parties is not covered by this privacy notice. We are not  	responsible for the content or privacy and security practices and  	policies of any third parties, including other websites, services or  	applications that may be linked to or from the App. You should  	review the policies of such third parties and contact them directly  	to respond to your questions.</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  </div>  <div id="Section10" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<strong><font color="#000000"><font style="font-size: 11pt" size="3">7.  	HOW LONG DO WE KEEP YOUR INFORMATION?</font></font></strong></p>  </div>  <div id="Section11" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<em><font color="#595959"><font style="font-size: 11pt" size="3">In  	Short:&nbsp;&nbsp;We keep your information for as long as necessary  	to fulfill the purposes outlined in this privacy notice unless  	otherwise required by law.</font></font></em></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">We will  	only keep your personal information for as long as it is necessary  	for the purposes set out in this privacy notice, unless a longer  	retention period is required or permitted by law (such as tax,  	accounting or other legal requirements). No purpose in this notice  	will require us keeping your personal information for longer than  	months past the termination of the user\'s account.</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">When we  	have no ongoing legitimate business need to process your personal  	information, we will either delete or anonymize such information,  	or, if this is not possible (for example, because your personal  	information has been stored in backup archives), then we will  	securely store your personal information and isolate it from any  	further processing until deletion is possible.</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  </div>  <div id="Section12" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<strong><font color="#000000"><font style="font-size: 11pt" size="3">8.  	WHAT ARE YOUR PRIVACY RIGHTS?</font></font></strong></p>  </div>  <div id="Section13" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<em><font color="#595959"><font style="font-size: 11pt" size="3">In  	Short:&nbsp; You may review, change, or terminate your account at  	any time.</font></font></em></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959">&nbsp;</font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">If you  	are a resident in the EEA or UK and you believe we are unlawfully  	processing your personal information, you also have the right to  	complain to your local data protection supervisory authority. You  	can find their contact details here:  	</font></font><a href="https://ec.europa.eu/justice/data-protection/bodies/authorities/index_en.htm" target="_blank"><font color="#3030f1"><font style="font-size: 11pt" size="3">https://ec.europa.eu/justice/data-protection/bodies/authorities/index_en.htm</font></font></a><font color="#595959"><font style="font-size: 11pt" size="3">.</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">If you  	are a resident in Switzerland, the contact details for the data  	protection authorities are available here:  	</font></font><a href="https://www.edoeb.admin.ch/edoeb/en/home.html" target="_blank"><font color="#3030f1"><font style="font-size: 11pt" size="3">https://www.edoeb.admin.ch/edoeb/en/home.html</font></font></a><font color="#595959"><font style="font-size: 11pt" size="3">.</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">If you  	have questions or comments about your privacy rights, you may email  	us at <a href="mailto:Info@maantheme.com" target="_blank">Info@maantheme.com</a>&nbsp;.</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<strong><font color="#000000"><font style="font-size: 11pt" size="3">Account  	Information</font></font></strong></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="line-height: 150%" align="left"><font color="#595959"><font style="font-size: 11pt" size="3">If  	you would at any time like to review or change the information in  	your account or terminate your account, you can:</font></font></p>  	<ul><li>  	<br></li></ul>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">Upon  	your request to terminate your account, we will deactivate or delete  	your account and information from our active databases. However, we  	may retain some information in our files to prevent fraud,  	troubleshoot problems, assist with any investigations, enforce our  	Terms of Use and/or comply with applicable legal requirements.</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<strong><font color="#595959"><font style="font-size: 11pt" size="3"><u>Cookies  	and similar technologies:</u></font></font></strong><font color="#595959"><font style="font-size: 11pt" size="3">  	Most Web browsers are set to accept cookies by default. If you  	prefer, you can usually choose to set your browser to remove cookies  	and to reject cookies. If you choose to remove cookies or reject  	cookies, this could affect certain features or services of our App.  	To opt-out of interest-based advertising by advertisers on our App  	visit </font></font><a href="http://www.aboutads.info/choices/" target="_blank"><font color="#3030f1"><font style="font-size: 11pt" size="3">http://www.aboutads.info/choices/</font></font></a><font color="#595959"><font style="font-size: 11pt" size="3">.  	</font></font>  	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="line-height: 150%" align="left"><strong><font color="#595959"><font style="font-size: 11pt" size="3"><u>Opting  	out of email marketing:</u></font></font></strong><font color="#595959"><font style="font-size: 11pt" size="3">  	You can unsubscribe from our marketing email list at any time by  	clicking on the unsubscribe link in the emails that we send or by  	contacting us using the details provided below. You will then be  	removed from the marketing email list — however, we may still  	communicate with you, for example to send you service-related emails  	that are necessary for the administration and use of your account,  	to respond to service requests, or for other non-marketing purposes.  	To otherwise opt-out, you may:</font></font></p>  	<ul><li><p class="western" style="line-height: 150%" align="left">Access  		your account settings and update your preferences.</p>  	</li></ul>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  </div>  <div id="Section14" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<strong><font color="#000000"><font style="font-size: 11pt" size="3">9.  	CONTROLS FOR DO-NOT-TRACK FEATURES</font></font></strong></p>  </div>  <div id="Section15" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">Most  	web browsers and some mobile operating systems and mobile  	applications include a Do-Not-Track ("DNT") feature or  	setting you can activate to signal your privacy preference not to  	have data about your online browsing activities monitored and  	collected. At this stage no uniform technology standard for  	recognizing and implementing DNT signals has been finalized. As  	such, we do not currently respond to DNT browser signals or any  	other mechanism that automatically communicates your choice not to  	be tracked online. If a standard for online tracking is adopted that  	we must follow in the future, we will inform you about that practice  	in a revised version of this privacy notice.&nbsp;</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  </div>  <div id="Section16" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<strong><font color="#000000"><font style="font-size: 11pt" size="3">10.  	DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?</font></font></strong></p>  </div>  <div id="Section17" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<em><font color="#595959"><font style="font-size: 11pt" size="3">In  	Short:&nbsp;&nbsp;Yes, if you are a resident of California, you are  	granted specific rights regarding access to your personal  	information.</font></font></em></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">California  	Civil Code Section 1798.83, also known as the "Shine The Light   	law, permits our users who are California residents to request and  	obtain from us, once a year and free of charge, information about  	categories of personal information (if any) we disclosed to third  	parties for direct marketing purposes and the names and addresses of  	all third parties with which we shared personal information in the  	immediately preceding calendar year. If you are a California  	resident and would like to make such a request, please submit your  	request in writing to us using the contact information provided  	below.</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">If you  	are under 18 years of age, reside in California, and have a  	registered account with the App, you have the right to request  	removal of unwanted data that you publicly post on the App. To  	request removal of such data, please contact us using the contact  	information provided below, and include the email address associated  	with your account and a statement that you reside in California. We  	will make sure the data is not publicly displayed on the App, but  	please be aware that the data may not be completely or  	comprehensively removed from all our systems (e.g. backups, etc.).</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  </div>  <div id="Section18" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<strong><font color="#000000"><font style="font-size: 11pt" size="3">11.  	DO WE MAKE UPDATES TO THIS NOTICE?</font></font></strong><font color="#000000"><font style="font-size: 11pt" size="3">&nbsp;</font></font><font color="#595959"><font style="font-size: 11pt" size="3">&nbsp;&nbsp;&nbsp;</font></font><font color="#7f7f7f">&nbsp;</font></p>  </div>  <div id="Section19" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<strong><font color="#595959"><font style="font-size: 11pt" size="3">In  	Short:&nbsp;</font></font></strong><em><font color="#595959"><font style="font-size: 11pt" size="3">  	Yes, we will update this notice as necessary to stay compliant with  	relevant laws.</font></font></em></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">We may  	update this privacy notice from time to time. The updated version  	will be indicated by an updated "Revised" date and the  	updated version will be effective as soon as it is accessible. If we  	make material changes to this privacy notice, we may notify you  	either by prominently posting a notice of such changes or by  	directly sending you a notification. We encourage you to review this  	privacy notice frequently to be informed of how we are protecting  	your information.</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  </div>  <div id="Section20" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<strong><font color="#000000"><font style="font-size: 11pt" size="3">12.  	HOW CAN YOU CONTACT US ABOUT THIS NOTICE?</font></font></strong><font color="#000000"><font style="font-size: 11pt" size="3">&nbsp;</font></font><font color="#595959"><font style="font-size: 11pt" size="3">&nbsp;&nbsp;&nbsp;</font></font><font color="#7f7f7f">&nbsp;</font></p>  </div>  <div id="Section21" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">If you  	have questions or comments about this notice, you may email us at  	<a href="mailto:Info@maantheme.com" target="_blank">Info@maantheme.com</a>&nbsp;or  	by post to:</font></font></p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<font color="#595959"><font style="font-size: 11pt" size="3">, </font></font>  	</p>  	<p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<br>    	</p>  </div>  <div id="Section22" dir="ltr"><p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  	<strong><font color="#000000"><font style="font-size: 11pt" size="3">13.  	HOW CAN YOU REVIEW, UPDATE, OR DELETE THE DATA WE COLLECT FROM  	YOU?</font></font></strong><font color="#000000"><font style="font-size: 11pt" size="3">&nbsp;</font></font><font color="#595959"><font style="font-size: 11pt" size="3">&nbsp;&nbsp;&nbsp;</font></font><font color="#7f7f7f">&nbsp;</font></p>  </div>  <p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  <br>    </p>  <p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  <font color="#595959"><font style="font-size: 11pt" size="3">Based on  the applicable laws of your country, you may have the right to  request access to the personal information we collect from you,  change that information, or delete it in some circumstances. To  request to review, update, or delete your personal information,  please submit a request form by clicking&nbsp;</font></font><a href="https://app.termly.io/notify/707fbcf1-9e8f-49bc-bbad-5ec5c8087e21" target="_blank"><font color="#3030f1"><font style="font-size: 11pt" size="3">here</font></font></a>.</p>  <p class="western" style="margin-bottom: 0in; line-height: 150%" align="left">  <br>    </p>  <p class="western" style="margin-bottom: 0in; line-height: 100%" align="left">  <br>    </p>    <style type="text/css">p { margin-bottom: 0.1in; direction: ltr; color: #000000; line-height: 115%; text-align: left; orphans: 2; widows: 2; background: transparent }p.western { font-family: "Liberation Serif", serif; font-size: 12pt; so-language: en-US }p.cjk { font-family: "Noto Serif CJK SC"; font-size: 12pt; so-language: zh-CN }p.ctl { font-family: "Lohit Devanagari"; font-size: 12pt; so-language: hi-IN }em { font-style: italic }a:link { color: #000080; so-language: zxx; text-decoration: underline }strong { font-weight: bold }</style>', 1, '2021-12-06 19:48:17', '2022-02-23 23:25:24'],
            [2, 15, 'Shipping Policy', '<p>There are many vAreations of passages of Lorem Ipsum available, but   the majority have suffered alteration in some form, by injected humour,   or randomised words which don\'t look even slightly believable. If you   are going to use a passage of Lorem Ipsum, you need to be sure there   isn\'t anything embarrassing hidden in the middle of text. All the Lorem   Ipsum generators on the Internet tend to repeat predefined chunks as   necessary, making this the first true generator on the Internet. It uses   a dictionary of over 200 Latin words, combined with a handful of model   sentence structures, to generate Lorem Ipsum which looks reasonable. The   generated Lorem Ipsum is therefore always free from repetition,   injected humour, or non-characteristic words etc.</p>', 1, '2021-12-06 19:49:07', '2022-02-17 01:16:05'],
            [3, 20, 'Cancellation Policy', '<p>Want to Learn How To Cancel Order on My Bazar? Well This Post Will Tell You How To Cancel My Bazar Order in 2022. </p>        <p>When you’re shopping online, it’s easy to get a little overboard and   excited with the various options available. Especially when there are   numerous deals and discounts present, one often ends up purchasing   products that were not needed. Or sometimes while shopping online, you   misread a certain product detail a little too late and have already   placed your order! </p>        <p>This can feel like a major bummer but no need to worry. My Bazar  understands these issues and has ensured to provide its customers with   an easy and convenient measure to cancel their orders! </p><h4>How To Cancel Order on My Bazar<br></h4>        <ol><li><br></li><li>To Cancel My Bazar order, Open My Bazar App and tap <strong>Account</strong></li><li> In My Order section, tap on <strong>View All</strong></li><li> From your orders, tap the one you wish to cancel.</li><li> Tap the <strong>Cancel</strong> button and fill the cancellation form.</li><li> Select your reason for cancellation.</li><li> Make sure you read and agree with the cancellation policy.</li><li> Then tap the <strong>Submit</strong> button.</li><li><br></li></ol>        <p>You will not be able to cancel the order but you may be able to   return your product if &nbsp;your order is already on its way to you or if   you have already received your order.</p><p align="center"><font color="#F7F7F7"><span style="background-color: rgb(66, 66, 66);"><strong>What is My Bazar Cancellation Policy</strong>?</span></font></p><p> Canceling your orders on My Bazar is easy and hassle-free, however, you must make sure that your orders meet <strong>the cancellation policy. </strong>My Bazar’s cancellation policy, states that you can cancel your order from your My Bazar account <em><strong>before</strong></em> the order is shipped out from My Bazar’s warehouse or has been dispatched by the seller. </p>        <p>If your order is already on its way to be shipped, you won’t be able   to cancel your order. So, stay prepared and have a happy shopping   experience with My Bazar! </p><p align="center"><font color="#F7F7F7"><span style="background-color: rgb(66, 66, 66);"></span></font></p><p align="center"><font color="#F7F7F7"><span style="background-color: rgb(66, 66, 66);"><br></span></font></p><h1 class="post-title lg">         </h1>', 1, '2021-12-21 23:27:38', '2022-02-23 23:13:55'],
            [4, 6, 'Support', '<p style="text-align:left;"><img style="width: 200px; float: left; margin-right: 25px;" src="data:image/png;base64," data-filename="TB18OkooQomBKNjSZFqXXXtqVXa.png" class="note-float-left"></p><ul class="lzd-contact-us-with-livechat-button _content-list"><li data-still-need-help="true" class="lzd-contact-us-with-livechat-button _content-item _need-help"><p style="text-align:left;"><span style="color: rgb(85,85,85);background-color: rgb(255,255,255);font-size: 16px;font-family: Helvetica Neue;" data-spm-anchor-id="a2a0e.11830474.3445881260.i0.1ccb68ceOUuCf0">For order status inquiry, please click </span><span style="color: rgb(44,130,201);background-color: rgb(255,255,255);font-size: 16px;font-family: Helvetica Neue;">here</span><span style="color: rgb(44,130,201);background-color: rgb(255,255,255);font-size: 16px;font-family: Helvetica Neue;">  .</span></p>    <p style="text-align:left;"><span style="color: rgb(85,85,85);background-color: rgb(255,255,255);font-size: 16px;font-family: Helvetica Neue;">To cancel and return ordered items, please log-in with your account</span> <span style="color: rgb(25,156,183);background-color: rgb(255,255,255);font-size: 16px;font-family: Helvetica Neue;">here</span> <span style="color: rgb(85,85,85);background-color: rgb(255,255,255);font-size: 16px;font-family: Helvetica Neue;">.</span>&nbsp;</p>    <p style="text-align:left;"><span style="color: rgb(85,85,85);background-color: rgb(255,255,255);font-size: 16px;font-family: Helvetica Neue;">For other concerns, feel free to visit our Help Center Page</span> <span style="color: rgb(25,156,183);background-color: rgb(255,255,255);font-size: 16px;font-family: Helvetica Neue;">here</span>&nbsp;</p>    <p style="text-align:left;"><span style="color: rgb(32,32,32);background-color: rgb(255,255,255);font-size: 16px;font-family: Helvetica Neue;">Can\'t find the answer you are looking for? </span></p>  <p><span style="color: rgb(32,32,32);background-color: rgb(255,255,255);font-size: 16px;font-family: Helvetica Neue;">Contact us through</span> <span style="color: rgb(32,32,32);background-color: rgb(255,255,255);font-size: 16px;font-family: Helvetica Neue;">LIVE CHAT (Sun to Fri: 7 AM - 9 PM and Sat: 9 AM - 9 PM) and we will assist you. </span></p><b>LIVE CHAT</b><br><br>Still need help? Click here        </li></ul>', 1, '2022-02-04 00:53:20', '2022-02-24 00:12:59'],
            [5, 14, 'Return Policy', '<ol class="custom-counter"><li data-spm-anchor-id="a2a0e.12026498.1651736270.i0.57dd400a7wrQRn">1. If   your product is damaged, defective, incorrect or incomplete at the time   of delivery, please raise a return request on My Bazar app or website. <strong>Return   request must be raised within 14 days for My Bazar\'s items, or within 7   days for non My Bazar\'s items from the date of delivery.</strong></li><li data-spm-anchor-id="a2a0e.12026498.1651736270.i2.57dd400a7wrQRn"><br></li><li data-spm-anchor-id="a2a0e.12026498.1651736270.i2.57dd400a7wrQRn">2. For   electronic appliances &amp; mobile phones related issues after usage or   after the return policy period, please check if the product is covered   under seller warranty or brand warranty. For more information on   warranty claims, please view our Warranty Policy.</li><li data-spm-anchor-id="a2a0e.12026498.1651736270.i5.57dd400a7wrQRn"><br></li><li data-spm-anchor-id="a2a0e.12026498.1651736270.i5.57dd400a7wrQRn">3. For   selected categories, we accept a change of mind. Please refer to the   section below on Return Policy per Category for more information.</li><li data-spm-anchor-id="a2a0e.12026498.1651736270.i5.57dd400a7wrQRn"><br></li></ol><h3>Valid reasons to return an item</h3><p><br></p><ol class="custom-counter"><li>1. Delivered product is damaged (i.e. physically destroyed or broken) / defective (e.g. unable to switch on)</li><li><br></li><li>2. Delivered product is incomplete (i.e. has missing items and/or accessories).</li><li><br></li><li>3. Delivered product is incorrect (i.e. wrong product/size/colour, fake item, or expired)</li><li><br></li><li>4. Delivered product is does not match product description or picture (i.e product not as advertised)</li><li><br></li><li data-spm-anchor-id="a2a0e.12026498.1651736270.i7.57dd400a7wrQRn">5. Delivered product does not fit. (i.e. size is unsuitable)</li></ol>', 1, '2022-02-04 00:56:10', '2022-02-23 23:33:42'],
